import React from 'react';
import ResumeDiv from './ResumeDiv';

const resume = () => {
  return (
    <div className='container'>
      <div className="route resume resume-para">
        <ResumeDiv h1='Shivam Sharma' summary='Software Developer' h5='summary' p='Seeking a position in an organisation focused on making human centric products with data driven decisions. With mentality to learn at each step, technical education along with diverse experience of working full-stack developer in an agile culture, I aim to deliver my best with productive outcomes.' />
        <ResumeDiv h5='experience' pre='Jan 2018 - July 2018 (Full-Time)' p='Worked as Front-End Developer with a team of developers, managers in an agile environment to solve problems for web .' />
        <ResumeDiv h5='education' h3='B.E in Information Technology' h5College='U.I.E.T, Panjab University, Chandigarh' pre='July 2014 - June 2018 (Full-Time)' p='Working knowledge of various languages helps me taking major decision in feasibilty and shaping the architecture. The education helps me in perceiving a developer’s point of view while approaching a problem.' />
        <ResumeDiv h5='competencies' />
        <div>
          <h5>competencies</h5>
          <li>1. C++</li>
          <li>2. Data Structures</li>
          <li>3. Algorithms</li>
          <li>4. HTML</li>
          <li>5. CSS</li>
          <li>6. JavaScript</li>
          <li>7. BootStrap 4</li>
          <li>8. ReactJS</li>
        </div>
      </div>
    </div>
  );
}

export default resume;
